import React from 'react';
import AdminLayout from '../../layouts/AdminLayout';

const AdminTrips = () => {
  return (
    <AdminLayout>
      <div className="max-w-6xl mx-auto">
        <div className="card">
          <h1 className="text-2xl font-bold text-gray-900 mb-4">Trip Management</h1>
          <p className="text-gray-600">Trip management - Coming soon!</p>
        </div>
      </div>
    </AdminLayout>
  );
};

export default AdminTrips;
